import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, ImageBackground,TextInput, Image, View, Component, Button, Alert } from 'react-native';

export default function App() {

  return (
    <View style={styles.container}>
      <Text>
        Username:
        Password:
      </Text>
      <StatusBar style="auto" />
      <ImageBackground 
      
        background={styles.backgroundImage} source={require('./assets/background.jpg')} />
      <TextInput
        style={{ height: 40, borderColor: '#fff', borderWidth: 2, backgroundColor:'gainsboro', borderRadius:'10' }}
        placeholder="email"
        onChangeText={() => setText("Hi")}
        
      />

      <Button
      title= "Login"
      onPress= {() => 
      Alert.alert("My title", "Message", [

        {text: "Yes", onPress: () => console.log("Yes")},
        {text: "No"},
      ]) 

      }
      />
    </View>
    
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#dogerblue',
    alignItems: 'center',
    justifyContent: 'center',   
  },
  logo: {
    width: 50,
    height: 50,
  },
  backgroundImage:{
    width:320,
    height: 480
  }
});
